Cerulean Studios Blog:
&quot;Build 71 is a minor bugfix build. Additionally, we?ve updated the ?Add Contact? panel in the Cordonata skin (Cobalt to follow) to include a built-in group chooser and, when supported, the ability to specify a ?Reason? when adding a contact. Certain networks (Astra, ICQ, Yahoo) support this.

The rest of the week was spent working on infrastructure for video calls both client-side and server-side; work will continue on this front and the results are looking very nice so far! We?ll update with more information as soon as we?re able to.  Enjoy the build.&quot;
